      </div>
      <img
        className="headerImgg"
        src="https://assets.imgix.net/enhance-examples/example-001.jpg?__hstc=158051173.d3d3229b4ec4a347671b5ab016e1b793.1637753923069.1637753923069.1637753923069.1&__hssc=158051173.5.1637753923070&__hsfp=1250135606"
        alt=""
      ></img>
    </div>
  );
}
